import React from 'react';
import Visualizer from "./AlgoVisualizer/Visualizer";
import './App.css';

function App() {
  return (
    <div className="App">
      <div>
        <h1 style={{margin:"40px 0px 0px 0px"}}>Algorithm Visualizer</h1>
      </div>
      <Visualizer></Visualizer>
      <LorenzAttractor></LorenzAttractor>
    </div>
  );
}

export default App;
